    React.useEffect(()=>{
        axios.get(baseUrl).then((response)=>{
            setPost(response.data);
        })
    }, [])

    function createPost(){
        axios.post("https://jsonplaceholder.typicode.com/posts", {title: "Hello World!",body: "This is a new post"}).then((response)=>{
            setName(response.data.name)
        });
    }
    if (!post) return null 
    return (
        <div className="App">
            <h1>{post.title}</h1>
